import React from "react";
import ReactDOM from "react-dom";
import SectionHeader from "./SectionHeader";

class WhyChooseUs extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className="container ">
        <SectionHeader
          headerName="Why choose us ?"
          headerDescribe="This is just a tetsing text, not much meaning, dont mind it so much. I wanted to give this lorem ipsum, but somehow it doesn work in my VSCode"
        />
      </div>
    );
  }
}
export default WhyChooseUs;
